import "@testing-library/jest-dom";
import "@testing-library/jest-dom";

describe('Console Error Override', () => {
  let originalError;

  beforeAll(() => {
    originalError = console.error;
  });

  afterAll(() => {
    console.error = originalError;
  });

  test('should suppress specific React 18 warning', () => {
    console.error = (...args) => {
      if (/Warning: ReactDOM.render is no longer supported in React 18./.test(args[0])) {
        return;
      }
      originalError.call(console, ...args);
    };

    console.error('Warning: ReactDOM.render is no longer supported in React 18.');

    expect(originalError).not.toHaveBeenCalled();
  });

  test('should not suppress other warnings', () => {
    const warningMessage = 'Warning: This is an unrelated warning.';

    console.error = (...args) => {
      if (/Warning: ReactDOM.render is no longer supported in React 18./.test(args[0])) {
        return;
      }
      originalError.call(console, ...args);
    };

    console.error(warningMessage);

    expect(originalError).toHaveBeenCalledWith(warningMessage);
  });
});
